import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

export default function Feed() {
    const [scrapPages, setScrapPages] = useState([]);

  useEffect(() => {
    const fetchScrapPages = async () => {
      try {
        const res = await axios.get('http://localhost:4000/scrap-pages');
        setScrapPages(res.data);
      } catch (error) {
        console.error('Error fetching scrapbook pages:', error);
      }
    };

    fetchScrapPages();
  }, []);

  return (
    <div>
      <h1>Scrapbook Pages</h1>
      <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
        {scrapPages.map((page) => (
          <div key={page._id} style={{ border: '1px solid #ccc', padding: '10px' }}>
            <h2>{page.name}</h2>
            <p>{page.description}</p>
            <div style={{ backgroundColor: page.color, padding: '5px', marginBottom: '10px' }}>
              Color Preview
            </div>
            <div style={{ display: 'flex', flexWrap: 'wrap', gap: '10px' }}>
              {page.binaryImages.map((image, index) => (
                <img
                  key={index}
                  src={image} // Base64 string directly used as the `src` attribute
                //   alt={`Scrapbook ${index}`}
                  style={{ width: '100px', height: '100px', objectFit: 'cover' }}
                />
              ))}
            </div>
            <h3>Stickers:</h3>
            {page.stickers.map((sticker, index) => (
              <div key={index}>
                <p>Sticker Type: {sticker.stickerType}</p>
                <p>Positions:</p>
                <ul>
                  {sticker.position.map((pos, posIndex) => (
                    <li key={posIndex}>
                      x: {pos.x}, y: {pos.y}
                    </li>
                  ))}
                </ul>
              </div>
            ))}
          </div>
        ))}
      </div>
    </div>
  );

    // return (
    // <div className="feed" alt="brown thread">
    //     <img src={threadImage} />
    //     <div>
    //         test
    //     </div>

    //     <Link to="login">
    //         <button>Login</button>
    //     </Link>
    // </div>
    // )
}
